import React from "react";
class Navi extends React.Component{
    constructor(props){
        super(props);
        this.state={
            name:"naveen kumar",
            city:"tadipatri",
            value:"wel come"
        }
    }
    render(){
        return(
            <div>
                {this.state.name}<br/>
                {this.state.city}<br/>
                {this.state.value}<br/>
                <button>Add</button>

            </div>
        )
    }
}
export default Navi;
